pragma solidity ^0.4.23;

import "./baxToken.sol";
import "./Migrations.sol";

contract TokenSale is baxToken, Migrations {
    uint256 public startPreWhitelistTime;
    uint256 public endPreWhitelistTime;
    uint256 public startPreICOTime;
    uint256 public endPreICOTime;
    uint256 public startWhitelistTime;
    uint256 public endWhitelistTime;
    uint256 public startICORound1Time;
    uint256 public endICORound1Time;
    uint256 public startICORound2Time;
    uint256 public endICORound2Time;
    uint256 public startICORound3Time;
    uint256 public endICORound3Time;
    uint256 public startICORound4Time;
    uint256 public endICORound4Time;

    uint256 public TOKEN_PER_ETHER_PRE_ICO;
    uint256 public TOKEN_PER_ETHER_ICO_ROUND_1;
    uint256 public TOKEN_PER_ETHER_ICO_ROUND_2;
    uint256 public TOKEN_PER_ETHER_ICO_ROUND_3;
    uint256 public TOKEN_PER_ETHER_ICO_ROUND_4;

    address public vaultAddress;

    bool public tokenSalePaused;
    bool public tokenSaleFinalized;
    bool public transferable;

    constructor(
        uint256 _startPreWhitelistTime,
        uint256 _endPreWhitelistTime,
        uint256 _startPreICOTime,
        uint256 _endPreICOTime,
        uint256 _startWhitelistTime,
        uint256 _endWhitelistTime,
        uint256 _startICORound1Time,
        uint256 _endICORound1Time,
        uint256 _startICORound2Time,
        uint256 _endICORound2Time,
        uint256 _startICORound3Time,
        uint256 _endICORound3Time,
        uint256 _startICORound4Time,
        uint256 _endICORound4Time
    ) public {
        require(now > _startPreWhitelistTime);
        require(now > _endPreWhitelistTime);
        require(now > _startPreICOTime);
        require(now > _endPreICOTime);
        require(now > _startWhitelistTime);
        require(now > _endWhitelistTime);
        require(now > _startICORound1Time);
        require(now > _endICORound1Time);
        require(now > _startICORound2Time);
        require(now > _endICORound2Time);
        require(now > _startICORound3Time);
        require(now > _endICORound3Time);
        require(now > _startICORound4Time);
        require(now > _endICORound4Time);

        require(_endPreWhitelistTime > _startPreWhitelistTime);
        require(_startPreICOTime > _endPreWhitelistTime);
        require(_endPreICOTime > _startPreICOTime);
        require(_startWhitelistTime > _endPreICOTime);
        require(_endWhitelistTime > _startWhitelistTime);
        require(_startICORound1Time > _endWhitelistTime);
        require(_endICORound1Time > _startICORound1Time);
        require(_startICORound2Time > _endICORound1Time);
        require(_endICORound2Time > _startICORound2Time);
        require(_startICORound3Time > _endICORound2Time);
        require(_endICORound3Time > _startICORound3Time);
        require(_startICORound4Time > _endICORound3Time);
        require(_endICORound4Time > _startICORound4Time);

        startPreWhitelistTime = _startPreWhitelistTime;
        endPreWhitelistTime = _endPreWhitelistTime;
        startPreICOTime = _startPreICOTime;
        endPreICOTime = _endPreICOTime;
        startWhitelistTime = _startWhitelistTime;
        endWhitelistTime = _endWhitelistTime;
        startICORound1Time = _startICORound1Time;
        endICORound1Time = _endICORound1Time;
        startICORound2Time = _startICORound2Time;
        endICORound2Time = _endICORound2Time;
        startICORound3Time = _startICORound3Time;
        endICORound3Time = _endICORound3Time;
        startICORound4Time = _startICORound4Time;
        endICORound4Time = _endICORound4Time;

        tokenSalePaused = false;
        tokenSaleFinalized = false;
        transferable = false;

    }

    function pauseTokenSale() onlyOwner {
        tokenSalePaused = true;
    }

    function resumeTokenSale() onlyOwner {
        tokenSalePaused = false;
    }

    
}
